import React, { Component } from 'react';
import '../App.css';
import { Row, Col } from 'reactstrap';

class Warmup extends Component {
    render() {
        let weight = this.props.weight;
        let toggle = {display: this.props.isToggle? 'block' : 'none'}
        let rowCollapse; 
        if (this.props.isToggle) {
            rowCollapse = "row"
        } else {
            rowCollapse = "Row-Collapse"
        }
        function round(num) {
            return Math.round(num*2)/2;
        }    
        return (
            <Container className='Table'>
            <Row className={rowCollapse}>
                <Col style={toggle}>A</Col>
                <Col style={toggle}>40</Col>
                <Col style={toggle}>5</Col>
                <Col style={toggle}>{(round(weight*4/10)).toFixed(1)}</Col>                                                                
            </Row>
            <Row className={rowCollapse}>
                <Col style={toggle}>B</Col>
                <Col style={toggle}>50</Col>
                <Col style={toggle}>5</Col>
                <Col style={toggle}>{(round(weight*5/10)).toFixed(1)}</Col>
            </Row>
            <Row className={rowCollapse}>
                <Col style={toggle}>C</Col>
                <Col style={toggle}>60</Col>
                <Col style={toggle}>3</Col>
                <Col style={toggle}>{(round(weight*6/10)).toFixed(1)}</Col>
            </Row>
            </Container>
            
        )
    }
}

export default Warmup;
